window.bookSummaryJSON = "<p>After successfully getting ahold of Grea's father and helping the man with his research in the Tri-Valor Valley, Asterios and his companions paid a surprise visit to Tina during her grand graduation, turning the event into something much bigger than the organizers intended. Now, with the talented Summoner girl amongst their ranks, they are ready to tackle the next big challenge on their path to discover more about Ast's past and lineage, setting their sights on the mysterious Descending Spire...</p> <p>Will everything go according to their plans? There are twists and turns behind every corner, they have already learned that much, and a certain very generous king did mention a gift during their last conversation. Asterios and Tina might be expecting something unusual, but they definitely aren't ready for how impactful it will be on their future.</p> <p>Perhaps it's time to find a good place that their slowly growing family will be able to call home.</p>"; 
